data.value:
Método utilizado para ubicar una región dentro del elemento contenedor en tiempo de ejecución.

"Imagen" ubicará la región buscando la imagen almacenada de la región en tiempo de ejecución;
destinado a elementos de forma con contenido estático como etiquetas, iconos y botones.

"Coordenadas" ubicará la región usando el rectángulo fijo que define la región;
destinado a elementos con contenido dinámico, como texto, casillas de verificación y cuadros combinados.
